import fbIcon from "../assets/images/icons/fb.png";
import ytIcon from "../assets/images/icons/yt.png";
import gmIcon from "../assets/images/icons/gm.png";

// NAVBAR
export const navbarItems = ["home", "contact", "music", "band"];

// CONTACTS
export const contacts = [{link: "https://www.facebook.com/PANFU.trio/", image: fbIcon, name: 'fbIcon'}]
